body:
  -
    value: "<p>The EIT Digital Alumni Foundation is happy to welcome Laena Nguyen as our new interim Events Officer. Laena was one of the organizers of the EIT Alumni Startup Days event last November, where she demonstrated to be a key resource in the coordination of the local Berlin chapter and the global collaboration with alumni&nbsp;from different cities and KICs. We celebrate that her initiative and commitment will now help driving our alumni community even further.</p>\r\n\r\n<p>Welcome, Laena!</p>\r\n"
